import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Home from "./Home";
import { Routes, Route } from "react-router-dom";

const App = () => {
  return (
    <>
      <Routes>
        <Route path="/" Component={Home} /> 
        <Route path="/about" Component={Home} /> 
        <Route path="/" Component={Home} /> 
        <Route path="/" Component={Home} /> 
      </Routes>
    </>
  );
};

export default App;
